import mnedef read_raw(fname):    """    Read raw FIF file and set channels.    Parameters    ----------    fname : file-like        Path to the -raw.fif file to load.    Returns    -------    raw : Raw        MNE raw instance.    """    raw = mne.io.read_raw_fif(fname, preload=True)    raw.rename_channels({'AUX3': 'Sound', 'AUX7': 'ECG'})    raw.set_channel_types({'Sound': 'misc', 'ECG': 'ecg'})    return raw